import Layout from "../components/Layout";

const Home = props => {
  return (
    <Layout>
      <div className="home d-flex justify-center">
        <div className="paint-container">
          <img className="canvas" src="/images/canvas.jpg" alt="canvas" />
          <img className="paint" src="/images/paint.jpg" alt="paint" />
        </div>
      </div>
      {/* <h1>Hello world</h1> */}
      <style jsx>
        {`
          .home {
            background-image: url("/images/blank-canvas.jpg");
            background-size: cover;
            background-position: center;
            height: 100vh;
            width: 100vw;
             {
            }
          }
          .paint-container {
            position: relative;
          }
          .canvas {
            width: 323px;
            height: 323px;
            position: absolute;
            top: 15%;
            box-shadow: 0px 10px 4px 2px #aa967d;
          }
          .paint {
            width: 323px;
            height: 323px;
            position: absolute;
            top: 15%;
            opacity: 0;
            transition: 0.2s;
          }
          .paint:hover {
            opacity: 1;
            transition: 0.2s;
          }
        `}
      </style>
    </Layout>
  );
};

export default Home;
